import React, { Component } from 'react';

class FiftyFiftyRightList extends Component {
    state = {  }
    render() { 
        const { news } = this.props;
        return ( 
            <React.Fragment>
                {news.map(eachnews =>
                <div class="widget-f-flist">
                    <div class="left-fifp"> {n} </div>
                    <div class="news_list">
                        <div>1</div>
                        <div>2</div>
                        <div>3</div>
                    </div>
                </div>
                )}       
                
            </React.Fragment>
         );
    }
}
 
export default FiftyFiftyRightList;
